import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'

import ProductsPage from './pages/ProductsPage'
import Header from './components/Header'

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/" exact Component={ProductsPage} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
